import MovieCard from "./MovieCard";
import Movie from '../data/Movie'
import Form from './Form'
function MovieList() {
  return (
    <div  style={{ display: "flex", flexWrap: "wrap", justifyContent: "center" }}>
       <Form/>
     { Movie.map((movies)=>(
        <MovieCard key={movies.id} {...movies}  />
        
      ))

     }
    
    </div>
  );
}

export default MovieList;
